import React, { useState } from "react";
import { NativeBaseProvider } from "native-base";
import Reactpip from "react-picture-in-picture";

import Loading from "../../packages/Loading/Loading";
export default function Card() {
  const [active, setActive] = useState(false);

  return (
    <NativeBaseProvider>
      <Loading />
      {/* Card */}
      <Reactpip isActive={active} width={"20px"} height={"30px"}>
        <source src="https://cdn.arnellebalane.com/videos/original-video.mp4" />
      </Reactpip>
      <button onClick={() => setActive(!active)}>
        Toggle Picture in Picture
      </button>
    </NativeBaseProvider>
  );
}
